/* Function block execution function */
void sifb_bfb_inputsrun(sifb_bfb_inputs* me)
{
    me->_output.events = 0;

    for (;;) {
        if (me->_state == 0) {
            // State: State1
            if (!me->_entered) {
                me->_entered = true;
            }
            else {
                if (me->_input.event.Start) {
                    me->_state = 1;
                    me->_entered = false;
                    continue;
                }
            }
        }
        else {
            // State: Start
            if (!me->_entered) {
                sifb_bfb_inputs_input_sifb_algo(me);
                me->_output.event.Tick = 1;
                me->_entered = true;
            }
            else {
                me->_state = 0;
                me->_entered = false;
                continue;
            }
        }
        break;
    }
    if (me->_output.event.Tick) {
        me->_Minute = me->Minute;
        me->_Price = me->Price;
        me->_Demand_kWh = me->Demand_kWh;
        me->_Day = me->Day;
        me->_Lenght = me->Lenght;
        me->_stop = me->stop;
        me->_Sma = me->Sma;
        me->_Std_dev = me->Std_dev;
    }

    me->_input.events = 0;
}

